const Posts = ({user, token, posts, fetchPosts}) => {



  return <div>
    <div className="content">
      <h1>Posts</h1>
    </div>
      {
      posts.map(post => <SinglePost key={post._id} post={post} user={user} token={token} fetchPosts={fetchPosts}>
        {

post && <Link to={`/posts/${post._id}`}> View Post </Link>
        }
        </SinglePost>)
      }

  </div>
};

